import React from 'react'

const AddEmployee = () => {
  return (
    <div className="flex w-items-center justify-center">
      <div>
        <div className="px-3 py-6 text-center bg-green-600 font-sans tracking-tighter text-white font-thin">
          Add New Employee
        </div>
        <div className="bg-slate-200 ">
          <label className="w-full px-4 font-extralight ">Name</label>
        </div>
      </div>
    </div>
  );
};

export default AddEmployee;
